//import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { Text, View, StyleSheet, ScrollView, TextInput, Button, TouchableOpacity, Image, ImageBackground, CheckBox, AppRegistry, Platform } from 'react-native';
import { Rating, AirbnbRating } from 'react-native-ratings';
import React, { Component } from 'react';
import Slider from '@react-native-community/slider';

class Filter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      //Initial Value of slider
      sliderValue: 15
    };
  }
  render() {
    const navigation = this.props.navigation;
    return (
      <ScrollView>
        <View style={styles.container}>
          <StatusBar style="auto" />
          <View style={styles.filterStyle}>
            <Text style={styles.titleStyle}> SELECT</Text>
            <View style={{ flexDirection: "row", width: '100%', }}>
              <View style={styles.checkboxContainer}>
                <CheckBox
                //value={isSelected}
                //onValueChange={setSelection}
                //style={styles.checkbox}
                />
                <Text style={styles.myMargin}>Services</Text>
              </View>
              <View style={styles.checkboxContainer}>
                <CheckBox
                //value={isSelected}
                //onValueChange={setSelection}
                //style={styles.checkbox}
                />
                <Text style={styles.myMargin}>Products</Text>
              </View>
            </View>

            <Text style={styles.titleStyle}> DISTANCE</Text>
            {/*Text to show slider value*/}
            <Text style={styles.headerText}>{this.state.sliderValue} km</Text>
            {/*Slider with max, min, step and initial value*/}
            <Slider
              maximumValue={100}
              minimumValue={0}
              minimumTrackTintColor="#00c7e4"
              maximumTrackTintColor="#cccccc"
              thumbTintColor="#00c7e4"
              step={1}
              value={this.state.sliderValue}
              onValueChange={(sliderValue) => this.setState({ sliderValue })}
              style={{ width: 300, height: 30 }}
            />

            <View style={styles.checkboxContainer}>
              <CheckBox
              //value={isSelected}
              //onValueChange={setSelection}
              //style={styles.checkbox}
              />
              <Rating
                type='custom'
                ratingColor='#00C8E4'
                ratingBackgroundColor='#708c9a'
                ratingCount={5}
                startingValue={5}
                imageSize={20}
                onFinishRating={this.ratingCompleted}
                style={{ paddingVertical: 5, marginStart: 12 }}
              />
            </View>
            <View style={styles.checkboxContainer}>
              <CheckBox
              //value={isSelected}
              //onValueChange={setSelection}
              //style={styles.checkbox}
              />
              <Rating
                type='custom'
                ratingColor='#00C8E4'
                ratingBackgroundColor='#708c9a'
                ratingCount={5}
                startingValue={4}
                imageSize={20}
                onFinishRating={this.ratingCompleted}
                style={{ paddingVertical: 4, marginStart: 12 }}
              />
            </View>
            <View style={styles.checkboxContainer}>
              <CheckBox
              //value={isSelected}
              //onValueChange={setSelection}
              //style={styles.checkbox}
              />
              <Rating
                type='custom'
                ratingColor='#00C8E4'
                ratingBackgroundColor='#708c9a'
                ratingCount={5}
                startingValue={3}
                imageSize={20}
                onFinishRating={this.ratingCompleted}
                style={{ paddingVertical: 5, marginStart: 12 }}
              />
            </View>
            <View style={styles.checkboxContainer}>
              <CheckBox
              //value={isSelected}
              //onValueChange={setSelection}
              //style={styles.checkbox}
              />
              <Rating
                type='custom'
                ratingColor='#00C8E4'
                ratingBackgroundColor='#708c9a'
                ratingCount={5}
                startingValue={2}
                imageSize={20}
                onFinishRating={this.ratingCompleted}
                style={{ paddingVertical: 5, marginStart: 12 }}
              />
            </View>
            <View style={styles.checkboxContainer}>
              <CheckBox
              //value={isSelected}
              //onValueChange={setSelection}
              //style={styles.checkbox}
              />
              <Rating
                type='custom'
                ratingColor='#00C8E4'
                ratingBackgroundColor='#708c9a'
                ratingCount={5}
